import React from "react";
import "../../../Styles/Pages/Forums/ForumsCard.scss";

function ForumsCard() {
  return (
    <div className='forumsCard'>
      <div className='forumsCardTitle'>
        <h2>Monster Arena: Battle</h2>
      </div>
    </div>
  );
}

export default ForumsCard;
